import { FuseLoadable } from "owp/@fuse";

export const C0204000Config = {
    settings: {
        layout: {
            config: {
                navbar        : {
                    display: true
                },
                toolbar       : {
                    display: true
                },
                footer        : {
                    display: true
                },
                leftSidePanel : {
                    display: true
                }
            }
        }
    },
    routes  : [
        {
            path     : '/pages/C0204000',
            component: FuseLoadable({
                loader: () => import('./C0204000')
            })
        },
        {
            path     : '/pages/C0204020',
            component: FuseLoadable({
                loader: () => import('./C0204020')
            })
        },
        {
            path     : '/pages/C0204030',
            component: FuseLoadable({
                loader: () => import('./C0204030')
            })
        },
        {
            path     : '/pages/C0204040',
            component: FuseLoadable({
                loader: () => import('./C0204040')
            })
        },
        {
            path     : '/pages/C0204050',
            component: FuseLoadable({
                loader: () => import('./C0204050')
            })
        }
    ]
};
